(54, 1, 'The Latest Buzz is a Canadian teen sitcom from Decode Entertainment aired on the Family Channel', '<h3 style="color: black; font-weight: bold; margin: 0.3em 0px 0px; overflow: hidden; padding-top: 0.5em; padding-bottom: 0px; border-bottom-style: none; font-size: 1.17em; line-height: 1.6; font-family: sans-serif; background-image: none; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span class="mw-headline" id="Main_characters">Main characters</span></h3><ul style="line-height: 22.3999996185303px; margin: 0.3em 0px 0px 1.6em; padding: 0px; list-style-image: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAUAAAANAQMAAABb8jbLAAAABlBMVEX///8AUow5QSOjAAAAAXRSTlMAQObYZgAAABNJREFUCB1jYEABBQw/wLCAgQEAGpIDyT0IVcsAAAAASUVORK5CYII=); color: rgb(37, 37, 37); font-family: sans-serif;"><li style="margin-bottom: 0.1em;"><b>Rebecca Harper</b>&nbsp;(<b><a href="http://en.wikipedia.org/w/index.php?title=Zo%C3%AB_Belkin&amp;action=edit&amp;redlink=1" class="new" title="Zoë Belkin (page does not exist)" style="color: rgb(165, 88, 88); background-image: none;">Zoë Belkin</a></b>) – A happy, eager girl, who sets her sights high and has big dreams, such as winning the Pulitzer Prize, Rebecca writes the&nbsp;<i><b>Student Issues</b></i>&nbsp;column, also known as ''<b>In So Many Words''</b>. She is the only one out of all her 5 co-writers that really intends to become a journalist. Her peers sometimes call her a nerd for being very efficient at things. She has a crush on her fellow buzz journalist Noah, and later on in the show they become a couple.&nbsp;</li></ul><img src="data:image/jpeg;base64," data-filename="the-latest-buzz-the-latest-buzz-2415434-1024-768.jpg" style="width: 898px;"><ul style="line-height: 22.3999996185303px; margin: 0.3em 0px 0px 1.6em; padding: 0px; list-style-image: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAUAAAANAQMAAABb8jbLAAAABlBMVEX///8AUow5QSOjAAAAAXRSTlMAQObYZgAAABNJREFUCB1jYEABBQw/wLCAgQEAGpIDyT0IVcsAAAAASUVORK5CYII=); color: rgb(37, 37, 37); font-family: sans-serif;"><li style="margin-bottom: 0.1em;"><b style="font-family: sans-serif; line-height: 22.3999996185303px;">Wilder Gulliver Atticus Wilder</b><span style="font-family: sans-serif; line-height: 22.3999996185303px;">&nbsp;(</span><b style="font-family: sans-serif; line-height: 22.3999996185303px;"><a href="http://en.wikipedia.org/wiki/Munro_Chambers" title="Munro Chambers" style="color: rgb(11, 0, 128); background-image: none;">Munro Chambers</a></b><span style="font-family: sans-serif; line-height: 22.3999996185303px;">) – Gaming obsessed and willing to try anything, Wilder covers</span><i style="font-family: sans-serif; line-height: 22.3999996185303px;"><b>Gaming</b></i><span style="font-family: sans-serif; line-height: 22.3999996185303px;">. His column in the magazine is ''</span><b style="font-family: sans-serif; line-height: 22.3999996185303px;">Game On''</b><span style="font-family: sans-serif; line-height: 22.3999996185303px;">. As good-natured as they come, Wilder is completely clueless about everything except sports and gaming. Only in one episode does Wilder not win or be completely focused during a game, because Amanda tried to flirt with him, making him lose focus. Wilder has a crush on Amanda and he gives her a coupon for her first kiss with him.&nbsp;</span></li></ul>', 'In this series, a struggling youth magazine, Teen BUZZ, replaces its staff with actual teens. Instead of being in class, five young writers take their last period of the day at the magazine’s office', '', '', '', '', 'buzzfeed', '1416824904.jpg', '2014-11-15 01:27:34', '2014-11-15 01:27:34', 4, 82);
