(67, 1, 'With 3.5 million downloads, ixigo’s strategy to unbundle apps', '<p><span style="color: rgb(85, 85, 85); font-family: Lato, sans-serif; font-size: 16px; line-height: 21px;">ixigo has six apps on Android with 3.5 million app downloads across them. Could they have done better with a single app? ixigo Founder Aloke Bajpai says</span></p><p><span style="color: rgb(85, 85, 85); font-family: Lato, sans-serif; font-size: 16px; line-height: 21px;"><br></span></p><img src="data:image/jpeg;base64," data-filename="2.jpg" style="width: 800px;"><p><span style="color: rgb(85, 85, 85); font-family: Lato, sans-serif; font-size: 16px; line-height: 21px;"><br></span><br></p>', 'With 3.5 million downloads, ixigo’s strategy to unbundle apps', '', '', '', '', '', 'N869PhVqYG1RjfiUHXDrO51o74GjuOyV.jpg', '2014-11-24 04:45:31', '2014-11-24 04:45:31', 1, NULL);
